import React, { useState } from "react";
import { Switch, Route, Router } from "react-router-dom";
import Login from "./components/Auth/Login";
import Main from "./components/Main";
import "./App.css";

function App() {
  return (
    <Switch>
      <Route exact path="/">
        <Main />
      </Route>
          <Route path="/login">
            <Login />
          </Route>

    </Switch>
  );
}

export default App;
